import React, { useState, useContext } from 'react'
import { useInfiniteQuery } from 'react-query'
import InfiniteScroll from 'react-infinite-scroller';
import jobConfig, { job } from '../config/dashboards/jobConfig'
import { UPDATE_SORTING } from '../reducers/jobReducerTypes'
import { JobContext } from '../context/jobContext'


export default function Table() {
    //@ts-ignore
    const [state, dispatch] = useContext(JobContext) ?? []
    const fields = jobConfig.fields
    const { data, status, hasNextPage, fetchNextPage, isSuccess
        //@ts-ignore
    } = useInfiniteQuery(["InfiniteQueryData", state], ({ pageParam = 1 }) => jobConfig.fetch(pageParam, state), {
        getNextPageParam: (_lastPage, allPages) => {
            const nextPage = allPages.length + 1
            return nextPage
        }
    })

    const sortData = (newSortOptions: { sortBy: string; }) => {
        if (state.sortOptions.sortBy !== newSortOptions.sortBy) {
            dispatch({ type: UPDATE_SORTING, payload: { sortBy: newSortOptions.sortBy, sortOrder: 'asc' } })
        } else {
            const newSortOrder = state.sortOptions.sortOrder === 'asc' || state.sortOptions.sortOrder === undefined ? 'desc' : 'asc'
            dispatch({ type: UPDATE_SORTING, payload: { sortBy: newSortOptions.sortBy, sortOrder: newSortOrder } })
        }
    }



    return (
        <div>
            {status === 'loading' && <h6>Loading...</h6>}
            {status === 'error' && <h6>There has been an error</h6>}

            {isSuccess &&
                //@ts-ignore
                data?.pages[0].length > 9 && <InfiniteScroll loadMore={fetchNextPage}
                    hasMore={hasNextPage}
                    loader={<h4>Loading...</h4>}
                    pullDownToRefresh={true}
                    key={0}
                >
                    <table className="table align-middle table-bordered table-striped table-hover table-responsive">
                        <thead className='bg-warning align-middle '>
                            <tr>
                                {Object.keys(fields)
                                    .map(fieldString =>
                                        <th className='pointer' scope="col" key={fieldString}
                                            onClick={() => sortData({ sortBy: fields[fieldString].name })}>
                                            <div key={fields[fieldString].label} className="d-flex justify-content-center align-items-center "
                                            >
                                                <span>
                                                    {fields[fieldString].label}
                                                </span>
                                                <i
                                                    className="fa fa-fw fa-sort"
                                                >
                                                </i>
                                            </div>
                                        </th>)}
                            </tr>
                        </thead>
                        <tbody>
                            {isSuccess &&
                                data.pages.map((page) => {
                                    return (page as job[]).map((e) => {
                                        return <tr key={e.id}>
                                            <th scope="row">{e.id}</th>
                                            <td>{e.originalId}</td>
                                            <td>{e.talentId}</td>
                                            <td>{e.talentName}</td>
                                            <td>{e.talentGrade}</td>
                                            <td>{e.bookingGrade}</td>
                                            <td>{e.operatingUnit}</td>
                                            <td>{e.officeCity}</td>
                                            <td>{e.officePostalCode}</td>
                                            <td>{e.jobManagerName}</td>
                                            <td>{e.jobManagerId}</td>
                                            <td>{e.totalHours}</td>
                                            <td>{e.startDate?.toString()}</td>
                                            <td>{e.endDate?.toString()}</td>
                                            <td>{e.clientName}</td>
                                            <td>{e.clientId}</td>
                                            <td>{e.industry}</td>
                                            <td>{e.requiredSkills?.map(skill =>
                                                <div>
                                                    <span className='m-2'>
                                                        {skill.name}
                                                    </span>

                                                </div>)}
                                            </td>
                                            <td>{e.optionalSkills?.map(skill =>
                                                <div>
                                                    <span>
                                                        {skill.name}
                                                    </span>
                                                </div>)}
                                            </td>
                                            <td>{e.isUnassigned ? 'true' : 'false'}</td>
                                        </tr>
                                    });
                                }
                                )}
                        </tbody>
                    </table>

                </InfiniteScroll>}
        </div>
    )
}
